import React from "react";
import "./Forecast.css";
import WeatherIcon from "./WeatherIcon";
import axios from "axios";

export default function Forecast(props) {
  const apiKey = "91afe9171359147d9b8594d8a2e6e434";
  let forecastApiUrl = `http://api.openweathermap.org/data/2.5/forecast?q=${props.city}&appid=${apiKey}&units=metric`;


  function showForecast(response) {
    console.log(response.data);

    for(let index = 0; index < 6; index++) {
      let forecast= response.data.list[index];
      let maxTemperature = forecast.main.temp.max;
      let minTemperature = forecast.main.temp.min;

    }
  }

  axios.get(forecastApiUrl).then(showForecast);

  return (
    <div className="card">
      <div className="card-body">
    <div className="row Forecast" id="forecast">
      <div className="col-2 text-center">
        <div className="forecast">
          <WeatherIcon icon={"01d"} size={40}/>
          <p>
            Tuesday <br />
            {minTemperature}ยบ/{maxTemperature}ยบ
          </p>
        </div>
      </div>
    </div>
    </div>
    </div>
  );
}
